How do you get motivated to do things when you don’t want to?

Want to hear a secret to getting things done, even when you don’t feel like it?

DO IT ANYWAY!!!

Motivation only goes so far, if we only did things when we felt motivated to do them, when we are full of excitement... we wouldn’t get much done. The secret to being successful in anything is doing the work or practice when you don’t necessarily want to. This is true for everything you want to master.

Eat well, when you don’t want to. Exercise, when you don’t want to. Put in the work, when you don’t want to. Practice, when you don’t want to.

Doing the things when you don’t feel like it will get you farther ahead then you can imagine. Because if you wait until you “feel like it” you won’t be consistent enough to see a significant change. Nobody feels like eating healthy all the time, nobody feels like waking up early all the time, nobody feels like practicing all the time... but you know who does it anyway? The people getting ahead in life.

